 import './ExpenseDate.css';
 export default function Expensedate(props) {
  let months = props.date.toLocaleString("en-US", { month: "long" });
  let days = props.date.toLocaleString("en-US", { day: "2-digit" });
  let year = props.date.getFullYear();

  return (
    <div>
      <div>{months}</div>
      <div>{days}</div>
      <div>{year}</div>
    </div>
  );
}
